import React, { useRef, useEffect, useState } from 'react';
import mapboxgl from 'mapbox-gl';
import 'mapbox-gl/dist/mapbox-gl.css';
import { Box, Typography } from '@mui/material';

// Replace with your Mapbox access token
// For a real application, you would store this in an environment variable
mapboxgl.accessToken = 'pk.eyJ1IjoibWFoaWFyIiwiYSI6ImNtNDY1YnlwdDB2Z2IybHEwd2w3MHJvb3cifQ.wJqnzFFTwLFwYhiPG3SWJA';

const OpportunityMap = ({ neighborhoods }) => {
  const mapContainerRef = useRef(null);
  const mapRef = useRef(null);
  const [mapError, setMapError] = useState(null);

  // Debug: Log neighborhoods data
  useEffect(() => {
    console.log('OpportunityMap received neighborhoods data:', neighborhoods);
    if (neighborhoods) {
      console.log('Number of features:', neighborhoods.features?.length);
      console.log('First feature:', neighborhoods.features?.[0]);
    }
  }, [neighborhoods]);

  // Initialize map when component mounts
  useEffect(() => {
    // Initialize map even if neighborhoods is null, we'll update it when data arrives
    console.log('Initializing map, neighborhoods data available:', !!neighborhoods);

    // Check if map is already initialized
    if (mapRef.current) return;

    try {
      console.log('Creating map with container:', mapContainerRef.current);

      const map = new mapboxgl.Map({
        container: mapContainerRef.current,
        style: 'mapbox://styles/mapbox/streets-v12', // Try a different style
        center: [-73.97, 40.75], // NYC coordinates (example)
        zoom: 10, // Zoom out a bit more
        attributionControl: true,
        preserveDrawingBuffer: true // This can help with rendering issues
      });

      console.log('Map initialized successfully');
      mapRef.current = map;

      // Add error handling
      map.on('error', (e) => {
        console.error('Mapbox error:', e);
        setMapError(`${e.error?.message || 'Unknown error'}`);
      });

      // Add navigation control (zoom buttons)
      map.addControl(new mapboxgl.NavigationControl(), 'top-right');

      map.on('load', () => {
        console.log('Map loaded, neighborhoods data available:', !!neighborhoods);

        if (!neighborhoods || !neighborhoods.features || neighborhoods.features.length === 0) {
          console.log('No neighborhood data available yet, will update when data arrives');
          return;
        }

        console.log('Adding neighborhood data to map');

        // Add the neighborhoods data as a source
        map.addSource('neighborhoods', {
          type: 'geojson',
          data: neighborhoods
        });

        // Add a layer for the neighborhood polygons
        map.addLayer({
          id: 'neighborhood-fills',
          type: 'fill',
          source: 'neighborhoods',
          layout: {},
          paint: {
            'fill-color': [
              'case',
              ['has', 'filtered'], // Check if the 'filtered' property exists
              [
                'case',
                ['==', ['get', 'filtered'], true], // If filtered is true
                [
                  'interpolate',
                  ['linear'],
                  ['get', 'opportunityScore'],
                  0, '#f7fbff',
                  2, '#d0e1f2',
                  4, '#94c4df',
                  6, '#4a98c9',
                  8, '#1764ab',
                  10, '#08306b'
                ],
                '#cccccc' // If filtered is false, use gray
              ],
              // If 'filtered' property doesn't exist, use the regular color scale
              [
                'interpolate',
                ['linear'],
                ['get', 'opportunityScore'],
                0, '#f7fbff',
                2, '#d0e1f2',
                4, '#94c4df',
                6, '#4a98c9',
                8, '#1764ab',
                10, '#08306b'
              ]
            ],
            'fill-opacity': 0.75
          }
        });

        // Add a layer for the neighborhood borders
        map.addLayer({
          id: 'neighborhood-borders',
          type: 'line',
          source: 'neighborhoods',
          layout: {},
          paint: {
            'line-color': '#000',
            'line-width': 1
          }
        });

        // Add a popup on hover
        const popup = new mapboxgl.Popup({
          closeButton: false,
          closeOnClick: false
        });

        map.on('mouseenter', 'neighborhood-fills', (e) => {
          map.getCanvas().style.cursor = 'pointer';

          const properties = e.features[0].properties;
          const filtered = properties.filtered !== undefined ? properties.filtered : true;

          if (filtered) {
            const coordinates = e.lngLat;

            const html = `
              <strong>${properties.name}</strong><br/>
              Opportunity Score: ${properties.opportunityScore}<br/>
              School Quality: ${properties.schoolQuality}<br/>
              ${properties.description}
            `;

            popup.setLngLat(coordinates).setHTML(html).addTo(map);
          }
        });

        map.on('mouseleave', 'neighborhood-fills', () => {
          map.getCanvas().style.cursor = '';
          popup.remove();
        });
      });

      // Clean up on unmount
      return () => map.remove();
    } catch (error) {
      console.error('Error initializing map:', error);
      setMapError(`Failed to initialize map: ${error.message}`);
    }
  }, [neighborhoods]);

  // Update the map when neighborhoods data changes
  useEffect(() => {
    if (!mapRef.current || !neighborhoods) return;

    const map = mapRef.current;

    if (map.isStyleLoaded() && map.getSource('neighborhoods')) {
      console.log('Updating neighborhoods data source');
      map.getSource('neighborhoods').setData(neighborhoods);
    }
  }, [neighborhoods]);

  return (
    <Box sx={{ width: '100%', height: '100%', position: 'relative' }}>
      {mapError ? (
        <Box sx={{ p: 3, textAlign: 'center', color: 'error.main' }}>
          <Typography>Error loading map: {mapError}</Typography>
        </Box>
      ) : (
        <Box ref={mapContainerRef} sx={{ width: '100%', height: '100%' }} />
      )}
    </Box>
  );
};

export default OpportunityMap;
